    false,nt"url": null,nt"notes": "This file contains a summary of the publicly
    available data from the GHG Reporting Program for 2010. This data includes non-confidential
    data reported by facilities that directly emit GHGs. The files also contain non-confidential
    information reported by suppliers of fossil fuels and industrial gases. This excel
    file contains the same information available in the Data Publication Tool. The file
    contains the most important, high-level information reported by direct emitters
    and suppliers and can be easily sorted to respond to many common queries.  Please
    visit https://www.epa.gov/ghgreporting for more information on the data.",nt"license_title":
